import React from "react";


class LoginPage extends React.Component {
    state = {
        username: null,
        password: null,
        pendingApiCall: false
    }

    render() {
        return (
            <form action="">
                <h1>Login Page</h1>
                <div>
                    <label htmlFor="">Username</label>
                    <input type="text"/>
                </div>
            </form>

        );
    }
}
